---

php5fpm_error_log: /var/log/php5-fpm/error.log

php5fpm_conf_open_basedir: /var/www/

php5fpm_conf_memory_limit: 256M

php5fpm_conf_opcache_memory_consumption: 256

php5fpm_conf_apc_shm_size: 256M

php5fpm_version: 5.6.24-23

php5fpm_ext_apcu_version: 4.0.11-23

php5fpm_ext_imagick_version: 3.4.3RC1-23

php5fpm_ext_igbinary_version: 1.2.1-23

php5fpm_ext_memcached_version: 2.2.0-23

php5fpm_ext_redis_version: 2.2.8-23